script: |
  super -f text -I q6350.spq | sort > q6350.out

inputs:
  - name: q6350.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN + col1 - + col1 / - col0 + + col0 AND - col0 * - col1 + col2 * - col2 * col2;
  - name: tab0

outputs:
  - name: q6350.out
    data: |
      15	81	47
      87	21	10
      97	1	99
